import React, { useState ,useEffect } from 'react'
import axios from 'axios'

const AlbumList = () => {
    const [albums,setAlbums]=useState([])


    useEffect(()=>{
        fetchAlbums()
    },[])


    return (
        <div>
            {
                albums.map((album)=>{
                    return <p>{album}</p>
                })
            }
        </div>
    )
}

export default AlbumList
